import React from 'react';
import 'antd/dist/antd.css';
import './App.css';
import Home, {HomeAdmin, Login, Station, Error, Logout} from "../containers";
import {BrowserRouter} from "react-router-dom";
import {PrivateRoute, PublicRoute} from "../components/PersonalRoute";


export default function App() {
    return (
        <BrowserRouter>
            <Switch>
                <PublicRoute exact path="/"><Login/></PublicRoute>
                <PublicRoute exact path="/login"><Login/></PublicRoute>
                <PublicRoute exact path="/logout"><Logout/></PublicRoute>
                <PublicRoute exact path="/error/:status"><Error/></PublicRoute>
                <PrivateRoute path="/root/:id"><HomeAdmin/></PrivateRoute>
                <PrivateRoute path="/home/:id"><Home/></PrivateRoute>
            </Switch>
        </BrowserRouter>
    );
}
